import React, { useState, useEffect } from 'react';
import { Table, message } from 'antd';
import axios from 'axios';

const DetectionResults = () => {
  const [results, setResults] = useState([]);
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    fetchResults();
  }, []);

  const fetchResults = async () => {
    setLoading(true);
    try {
      const response = await axios.get('http://10.201.24.153:8000/api/detection_results/1');
      setResults(response.data);
    } catch (error) {
      message.error('获取检测结果失败！');
    } finally {
      setLoading(false);
    }
  };

  const columns = [
    { title: '结果ID', dataIndex: 'result_id', key: 'result_id' },
    { title: '视频ID', dataIndex: 'video_id', key: 'video_id' },
    { title: '检测时间', dataIndex: 'detected_at', key: 'detected_at' },
    { title: '结果JSON', dataIndex: 'result_json', key: 'result_json' }
  ];

  return (
    <div style={{ padding: '50px 0' }}>
      <h2>检测结果</h2>
      <Table columns={columns} dataSource={results} loading={loading} rowKey="result_id" />
    </div>
  );
};

export default DetectionResults;
